import { fromJS } from 'immutable';
import React, {Component} from 'react';
import {HomeWrapper,HomeLeft,HomeRight} from './style'
class Home extends Component {
    render(){
        return (
            <HomeWrapper>
                <HomeLeft>
                    <img></img>
                </HomeLeft>
                <HomeRight></HomeRight>
            </HomeWrapper>
        )
    }
}

export default Home;
